  margin: 30px 8vw;
  display: grid;
  grid-template-columns: repeat(auto-fill, minmax(300px, 1fr));
  grid-gap: 20px;
`;

const Img = styled.img`
  width: 100%;
  margin-bottom: 20px;
`;
const Column = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
